import React from 'react';
import { Navbar, Nav, Container, NavDropdown, Image } from 'react-bootstrap';

function MyNavbar (){
return (
    <Navbar expand="lg" className="bg-primary navbar-dark fixed-top">
    <Container>
      {/* Logo e título */}
      <Navbar.Brand href="#" className="text-white">
        <strong>Currículo</strong>
      </Navbar.Brand>

      {/* Botão de alternar para mobile */}
      <Navbar.Toggle aria-controls="basic-navbar-nav" />

     
      <Navbar.Collapse id="basic-navbar-nav">
        <Nav className="mx-auto">
          <Nav.Link href="#exibir" className="text-white mx-3">
            Exibir Currículo
          </Nav.Link>
          <Nav.Link href="#editar" className="text-white mx-3">
            Editar Currículo
          </Nav.Link>
        </Nav>


        <Nav>
          <Nav.Link href="#profile">
            <Image
              src="https://via.placeholder.com/40"
              alt="Avatar"
              roundedCircle
              width={40}
              height={40}
              className="border border-white"
            />
          </Nav.Link>
        </Nav>
      </Navbar.Collapse>
    </Container>
  </Navbar>
  );
}

export default MyNavbar;
